local function drawLine(a, b, parent)
	local v = (b - a);
	local cf = CFrame.new(a + v * 0.5, b);
	local line = part:Clone();
	line.CFrame = cf;
	line.Size = Vector3.new(0.1, 0.1, v.magnitude);
	line.BrickColor = BrickColor.Red();
	line.Parent = parent;
	return line;
