class Matrix:
    def __init__(self, data):
        self.data = data
        self.n = len(data)  
    

    @staticmethod
    def pad_zeros(matrix, new_dim):
        padded_data = []
        for row in matrix.data:
            padded_row = row + [0] * (new_dim - len(row))
            padded_data.append(padded_row)
        for _ in range(new_dim - matrix.n):
            padded_data.append([0] * new_dim)
        return Matrix(padded_data)
    

    def multiply(matrix1, matrix2):
        e1 = 0
        n1 = matrix1.n
        while n1 % 2 == 0:
            n1 //= 2
            e1 += 1

        if n1 != 1:
            matrix1 = Matrix.pad_zeros(matrix1, int(2 ** (e1 + 1)))
            matrix2 = Matrix.pad_zeros(matrix2, int(2 ** (e1 + 1)))

        result = [[0] * matrix1.n for _ in range(matrix1.n)]  
        for i in range(matrix1.n):
            for j in range(matrix1.n):
                for k in range(matrix1.n):
                    result[i][j] += matrix1.data[i][k] * matrix2.data[k][j]
        return Matrix(result)



    def block(self):
        median = self.n//2
        upper_left = []
        upper_right = []
        lower_left = []
        lower_right = []

        for i in range(median):
            upper_left.append(self.data[i][:median])
            upper_right.append(self.data[i][median:])
        
        for i in range(median, self.n):
            lower_left.append(self.data[i][:median])
            lower_right.append(self.data[i][median:])
    
        return [Matrix(upper_left), Matrix(upper_right), Matrix(lower_left), Matrix(lower_right)]


    

