struct s_free_list_node
{
	b8 used;
	size_t size;
	s_free_list_node* next;
};


struct s_free_list
{
	size_t capacity;
	u8* memory;
	s_free_list_node* first;

	void* alloc(size_t in_size);
	void* realloc(void* ptr, size_t in_size);
	void free(void* ptr);
};


void* s_free_list::alloc(size_t in_size)
{
	assert(in_size > 0);
	size_t aligned_size = (in_size + 7) & ~7;

	void* result = null;
	for(s_free_list_node* node = first; node; node = node->next)
	{
		if(!node->used && node->size >= aligned_size)
		{
			node->used = true;
			result = (u8*)node + sizeof(s_free_list_node);
			if(!node->next)
			{
				s_free_list_node* new_node = (s_free_list_node*)((u8*)result + aligned_size);
				*new_node = zero;
				new_node->size = node->size - aligned_size - sizeof(s_free_list_node);
				node->next = new_node;
				node->size = aligned_size;
			}
			break;
		}
	}
	assert(result);
	return result;
}

void* s_free_list::realloc(void* ptr, size_t in_size)
{
	s_free_list_node* node = (s_free_list_node*)((u8*)ptr - sizeof(s_free_list_node));
	size_t aligned_size = (in_size + 7) & ~7;

	assert(in_size > 0);
	assert(node->used);
	assert(node->size > 0);
	assert(node->size <= capacity - sizeof(s_free_list_node));

	if(aligned_size <= node->size)
	{
		return ptr;
	}
	free(ptr);
	return alloc(aligned_size);
}

void s_free_list::free(void* ptr)
{
	s_free_list_node* node = (s_free_list_node*)((u8*)ptr - sizeof(s_free_list_node));
	s_free_list_node* temp = node;

	assert(node->used);
	assert(node->size > 0);
	assert(node->size <= capacity - sizeof(s_free_list_node));

	node->used = false;

	// @Note(tkap, 15/07/2023): Merge the following nodes if possible
	while(true)
	{
		temp = temp->next;
		if(!temp) { break; }
		if(temp->used) { break; }
		node->size += temp->size + sizeof(s_free_list_node);
		node->next = temp->next;
	}
}

func s_free_list make_free_list(void* memory, size_t capacity)
{
	assert(capacity >= 1024);
	s_free_list result = zero;
	result.capacity = capacity;
	result.memory = (u8*)memory;

	s_free_list_node first = zero;
	first.size = capacity - sizeof(s_free_list_node);
	result.first = (s_free_list_node*)result.memory;
	*result.first = first;
	return result;
}

Certainly! I can help you with using Mongoose in a Node.js Express application to create an API that filters data from the "sample_mflix" database in MongoDB Atlas. Here's a step-by-step guide:

1. Install dependencies:
   - Install Mongoose and Express using npm or yarn:
     ```shell
     npm install mongoose express
     ```

2. Set up the database connection:
   - Create a `db.js` file to establish the connection with MongoDB Atlas:
     ```javascript
     const mongoose = require('mongoose');

     const connectDB = async () => {
       try {
         await mongoose.connect('mongodb+srv://<username>:<password>@<cluster-url>/<database>?retryWrites=true&w=majority', {
           useNewUrlParser: true,
           useUnifiedTopology: true,
         });
         console.log('Connected to MongoDB Atlas');
       } catch (error) {
         console.error('Failed to connect to MongoDB Atlas:', error);
         process.exit(1);
       }
     };

     module.exports = connectDB;
     ```

3. Set up the Express server:
   - Create an `app.js` file to configure the Express server:
     ```javascript
     const express = require('express');
     const connectDB = require('./db');

     const app = express();

     // Connect to MongoDB Atlas
     connectDB();

     // Define routes and middleware here

     // Start the server
     const port = 3000;
     app.listen(port, () => {
       console.log(`Server running on port ${port}`);
     });
     ```

4. Define a Movie schema and model:
   - Create a `models/Movie.js` file to define the schema and model for the "movies" collection:
     ```javascript
     const mongoose = require('mongoose');

     const movieSchema = new mongoose.Schema({
       title: String,
       year: Number,
       language: String,
       country: String,
       // Add other fields as per your requirements
     });

     const Movie = mongoose.model('Movie', movieSchema);

     module.exports = Movie;
     ```

5. Create an API route for filtering movies:
   - In the `app.js` file, add the following route to handle movie filtering requests:
     ```javascript
     const express = require('express');
     const Movie = require('./models/Movie');

     // ...

     app.get('/movies', async (req, res) => {
       try {
         const { year, language, country } = req.query;

         const filter = {};
         if (year) filter.year = Number(year);
         if (language) filter.language = language;
         if (country) filter.country = country;

         const movies = await Movie.find(filter);

         res.json(movies);
       } catch (error) {
         console.error('Error fetching movies:', error);
         res.status(500).json({ error: 'Internal Server Error' });
       }
     });
     ```

6. Start the server:
   - Run the application using `node app.js` or `nodemon app.js` if you have nodemon installed.

