For example, to filter movies released in 2021, you can make a GET request to `http://localhost:3000/movies?year=2021`. Similarly, you can add more query parameters to further filter the results.

Remember to replace `<username>`, `<password>`, `<cluster-url>`, and `<database>` in the `db.js` file with your MongoDB Atlas credentials and database details.

