    int verHor = 0; // 0 : horizontal, 1 : vertical
    char winner = ' ';
    loop:
    for ( int i = 0; i < 3; i++ ) {
        if (verHor == 0) {
            goto horizontal;
        } if ( verHor == 1) {
            goto vertical;
        }
        goto wincheck;

        
        horizontal:
        if (board[i][0] == board[i][1] && board[i][0] == board[i][2]) {
            winner = board[i][0];
            goto wincheck;
        } vertical:    if (board[0][i] == board[1][i] && board[0][i] == board[2][i]) {
            winner = board[0][i];
            goto wincheck;
        }
    }
    verHor++;
    if(verHor < 1) { goto loop; }
    if (board[0][0] == board[1][1] && board[0][0] == board[2][2]) {
        winner = board[0][0];
    } if (board[0][2] == board[1][1] && board[0][2] == board[2][0]){
        winner = board[0][2];
    }
    wincheck:
